async function netReturn(company) {
    var currentTimeInSeconds=Math.floor(Date.now()/1000);
    var startTime = currentTimeInSeconds - 86400*3
    const finnhub = require('finnhub');
    var net = 0

    const api_key = finnhub.ApiClient.instance.authentications['api_key'];
    api_key.apiKey = "c7r1k2qad3ia6nr4u7r0"
    const finnhubClient = new finnhub.DefaultApi()

    await finnhubClient.stockCandles(company, "D", startTime, currentTimeInSeconds, (error, data, response) => {
        net = data.c[1] - data.c[0]
    });
}

export default netReturn;
